import React from 'react';
import home from "./images/icon/home.png";

export default class TopNav extends React.Component {
    render() {
        return (
            <div>
                <a href="/"><img src={home}/></a>
                <a href="/news"><img src="images/icon/home.png"/></a>
                <a href="/students"><img src="images/icon/student.png"/></a>
                <a href="/colleges"><img src="images/icon/school.png"/></a>
                <a href="/about"><img src="images/icon/about.png"/></a>
                <h2>Kosen Community</h2>
            </div>
        )
    }
}
